import styled from 'styled-components';


export const UserInfoWrap = styled.div`
display: flex;
justify-content: center;
align-items: center;
margin: 15px;
`

export const IconWrap = styled.div`
font-weight: bold;
color: #35586C ;
img{
    border-radius: 50%;
}

`
const Image=styled.img`
`

export const UserInfo = styled.div`
margin: 12px;
margin-top: 35px;

`
